import React, {useEffect, useState} from 'react';
import axios from 'axios';
import ArticlesClosingAPI from '../services/ArticlesClosingAPI';

export default function ArticlesClosing() {
    const [isLoading, setIsLoading] = useState(true)
    const [articles, setArticles] = useState(null)

    useEffect(() => {
        ArticlesClosingAPI.findAllClosing();
    },[])

    return (
        <div>
            <ul>
                {
                    isLoading ? 'Loading...' : articles.map(article => <li key={article.attributes.id}>{article.attributes.title}</li>)
                }
            </ul>
        </div>
    )
}
